INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 1, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 1, 0.0, "2020/04/30 12:00:00", 24001, 24, 0.0, 0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 1, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, "2020/04/30 12:00:00", 24002, 24, 0.0, 1);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 1, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 0.0, "2020/04/30 12:00:00", 24003, 24, 0.0, 2);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 2, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 2, 0.0, "2020/04/30 12:00:00", 24004, 24, 0.0, 3);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 1, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 0.0, "2020/04/30 12:00:00", 24005, 24, 0.0, 4);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 2, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 0.0, "2020/04/30 12:00:00", 24006, 24, 0.0, 5);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 2, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 2, 0.0, "2020/04/30 12:00:00", 24007, 24, 0.0, 6);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 4, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 0.0, "2020/04/30 12:00:00", 24008, 24, 0.0, 7);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 4, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 0.0, "2020/04/30 12:00:00", 24009, 24, 0.0, 8);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 4, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 4, 0.0, "2020/04/30 12:00:00", 24010, 24, 0.0, 9);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 4, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 4, 0.0, "2020/04/30 12:00:00", 24011, 24, 0.0, 10);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 0.0, 4, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 0.0, "2020/04/30 12:00:00", 24012, 24, 0.0, 11);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10040, 102601, "リン", 1.81, 4, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 1, 0.0, "2020/04/30 12:00:00", 24013, 24, 0.0, 12);
